using System;
using System.IO;
using UnityEngine;
using UnityEngine.InputSystem;

public class SpeechToSpeech : MonoBehaviour
{
    private AudioRecorder audioRecorder;
    private OpenAISpeechAPI openAISimpleAPI;

    void Start()
    {
        audioRecorder = GetComponent<AudioRecorder>();
        openAISimpleAPI = GetComponent<OpenAISpeechAPI>();
    }

    void Update()
    {
        // Start recording when space is pressed down
        //if (Input.GetKeyDown(KeyCode.Space))
        if(Keyboard.current.spaceKey.wasPressedThisFrame)
        {
            audioRecorder.StartRecording();
            Debug.Log("Recording started...");
        }

        if (Keyboard.current.tKey.wasPressedThisFrame)
        {
            StartCoroutine(openAISimpleAPI.TestAudioReceiving());
             Debug.Log("Recording started...");
        }

        // Stop recording when space is released
        if (Keyboard.current.spaceKey.wasReleasedThisFrame)
        {
            audioRecorder.StopRecording();
            Debug.Log("Recording stopped.");

            // Process the audio and send it to OpenAI
            string filePath = audioRecorder.GetFilePath();
            StartCoroutine(openAISimpleAPI.SendAudioToAPI(filePath));
        }
        
        if (Keyboard.current.cKey.wasPressedThisFrame)
        {
            string base64Wav = "";

            byte[] wavData = Convert.FromBase64String(base64Wav);
            
            WavUtility.SaveWavFile(base64Wav, "test.wav");
            AudioClip audioClip = WavUtility.ToAudioClip(base64Wav);  // Convert byte[] to AudioClip using a WAV utility
            AudioSource audioSource = GetComponent<AudioSource>();
            audioSource.clip = audioClip;
            audioSource.Play();

        }
    }
}
